$(document).on("click","#submit_billing_address",function(s){s.preventDefault(),$(this).closest("form").ajaxSubmit({forceSync:!0,beforeSend:function(s,e){alertify.message('<div class="partial-loader"></div>',0)},success:function(s){s.success?(alertify.success(s.msg).dismissOthers(),$("#billing_address_modal").modal("hide")):alertify.error(s.msg).dismissOthers()},error:function(s,e,i){alertify.error(e).dismissOthers()}})});
